import React, { Component } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser, getProfile } from "../../actions/authActions";

class NavbarOrganizer extends Component {
    onLogoutClick = e => {
        e.preventDefault();
        this.props.logoutUser();
    };

    onProfileClick = e => {
        e.preventDefault();
        this.props.getProfile();
        this.props.history.push("/profile");
    };

    render() {
        return (
            <div className="navbar" style={{backgroundColor:"eea29a"}}>
                <nav className="z-depth-0">
                    <div className="nav-wrapper">
                        <Link
                            to="/timelineorganizer"
                            style={{
                                fontFamily: "monospace"
                            }}
                            className="brand-logo">
                            <i className="material-icons">event</i>
                            EventsBook        
                        </Link>
                        <ul className="right">
                            <li>
                                <Link
                                    to="/profile"
                                    style={{
                                        fontFamily: "monospace"
                                    }}
                                    className="right hide-on-med-and-down">
                                    {/* <i className="material-icons">account_box</i> */}
                                    Profile        
                                </Link>        
                            </li>
                            <li>
                                <Link
                                    to="/createPost"
                                    style={{
                                        fontFamily: "monospace"
                                    }}
                                    className="right hide-on-med-and-down">
                                    {/* <i className="material-icons">account_box</i> */}
                                    <span onClick={this.onProfileClick}>Post an Event</span>       
                                </Link>        
                            </li>
                            <li>
                                <button 
                                    style={{
                                        width: "150px",
                                        borderRadius: "3px",
                                        letterSpacing: "1.5px",
                                        marginTop: "1rem"
                                    }}
                                    onClick={this.onLogoutClick}
                                    className="btn btn-large waves-effect waves-light hoverable blue-accent-3">
                                        Logout
                                </button>        
                            </li>
                        </ul>
                    </div>
                </nav>
            </div>
        );
    }
}

NavbarOrganizer.propTypes = {
    logoutUser: PropTypes.func.isRequired,
    getProfile: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
    auth: state.auth
});

export default connect (
    mapStateToProps,
    { logoutUser, getProfile }
)(NavbarOrganizer);
